    "contracts/FED.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "./interfaces/IRouter.sol";
import "./interfaces/IFactory.sol";
import "./BEP20.sol";

contract FED is BEP20, Ownable {
    using Address for address payable;

    IRouter public router;
    address public pair;

    bool private _interlock = false;
    bool public provideLiquidity = false;

    address public marketingWallet;
    address public constant deadWallet = 0x000000000000000000000000000000000000dEaD;
    address public routerAddress;

    struct Taxes {
        uint256 marketing;
        uint256 liquidity;
    }

    Taxes public taxes = Taxes(2, 1);

    modifier lockTheSwap() {
        if (!_interlock) {
            _interlock = true;
            _;
            _interlock = false;
        }
    }

    constructor() BEP20("FED INU", "FED") {
        _tokengeneration(msg.sender, 1e8 * 10**decimals());
    }

    function setRouterAndPair(address _routerAddress) external onlyOwner {
        routerAddress = _routerAddress;

        IRouter _router = IRouter(_routerAddress);
        // Create a pancake pair for this new token
        // address _pair = IFactory(_router.factory()).createPair(address(this),_router.WETH());
        address _pair = IFactory(_router.factory()).getPair(address(this),_router.WETH());

        router = _router;
        pair = _pair;
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(
            currentAllowance >= amount,
            "BEP20: transfer amount exceeds allowance"
        );
        _approve(sender, _msgSender(), currentAllowance - amount);

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        override
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender] + addedValue
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        override
        returns (bool)
    {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue,"BEP20: decreased allowance below zero");
        _approve(_msgSender(), spender, currentAllowance - subtractedValue);

        return true;
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal override {
        require(amount > 0, "Transfer amount must be greater than zero");
        
        uint256 feeswap;
        uint256 fee;
        Taxes memory currentTaxes;

        //calculate fee
        feeswap = taxes.liquidity + taxes.marketing;
        currentTaxes = taxes;
        fee = (amount * feeswap) / 100;

        if (provideLiquidity && recipient == pair) {
            _approve(sender, address(this), fee);
            super._transfer(sender, address(this), fee);
            liquidify(fee, currentTaxes);
        } else {
            fee = 0;
        }

        //transfer rest to recipient
        super._transfer(sender, recipient, amount - fee);
  }

    function liquidify(uint256 fee, Taxes memory swapTaxes) private lockTheSwap {
        if (fee == 0) {
            return;
        }

        uint256 denominator = swapTaxes.liquidity + swapTaxes.marketing;
        
        uint256 marketingAmt = fee * swapTaxes.marketing / denominator;
        if (marketingAmt > 0) {
            super._transfer(address(this), marketingWallet, marketingAmt);
        }

        uint256 liquidityAmt = fee * swapTaxes.liquidity / denominator;

        uint256 halfLiquidityAmt = liquidityAmt / 2;
        uint256 initialBalance = address(this).balance;
        swapTokensForETH(halfLiquidityAmt);
        uint256 ethToAddLiquidityWith = address(this).balance - initialBalance;
        if (ethToAddLiquidityWith > 0) {
            // Add liquidity to pancake
            addLiquidity(halfLiquidityAmt, ethToAddLiquidityWith);
        }
    }

    function swapTokensForETH(uint256 tokenAmount) private {
        // generate the pancake pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();

        _approve(address(this), address(router), tokenAmount);

        // make the swap
        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(router), tokenAmount);

        // add the liquidity
        router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            deadWallet,
            block.timestamp
        );
    }

    function updateMarketingWallet(address newWallet) external onlyOwner {
        require(newWallet != address(0), "Fee Address cannot be zero address");
        marketingWallet = newWallet;
    }

    function updateProvideLiquidity(bool state) external onlyOwner {
        provideLiquidity = state;
    }

    function updateTaxes(uint256 liquidity, uint256 marketing) external onlyOwner() {
        require(liquidity < 16 && marketing < 16, "FED: tax cannot exceed 15%");
        taxes.liquidity = liquidity;
        taxes.marketing = marketing;
    }

    function rescueBNB(uint256 weiAmount) external onlyOwner {
        payable(owner()).transfer(weiAmount);
    }

    function rescueBSC20(address tokenAdd, uint256 amount) external onlyOwner {
        require(tokenAdd != address(this), "Owner can't claim contract's balance of its own tokens");
        IBEP20(tokenAdd).transfer(owner(), amount);
    }

